import React from 'react';

const AddProduct = () => {
    const [name, setName] = React.useState("");
    const [price, setPrice] = React.useState("");
    const [category, setCategory] = React.useState("");
    const handleProduct = () => {
        console.warn(name,price,category);
    }
    return (
        <div className='register'>
            <input className='inputBox' onChange={(e) => setName(e)} type="text" placeholder='Enter Name' />
            <input className='inputBox' onChange={(e) => setPrice(e)} type="text" placeholder='Enter Price' />
            <input className='inputBox' onChange={(e) => setCategory(e)} type="text" placeholder="Enter Category" />
            <button className='appButton' onClick={handleProduct} >Submit</button>
        </div>
    )
};

export default AddProduct;
